INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (53797, 16, 882, 'Very high quality Cool and powerful Top performance among all RTX s The product arrived pretty much on time Very good packaging composed of fragile tapes all around an outermost layer of bubblewrap a layer of recycled cartonbox another layer of thick bubblewrap and finally the graphics cards box itself with additional protection inside Still remember to ALWAYS take a video when unpacking to be super safe The card is BIG one of the biggest among all RTX s and for good reason Its cooling performance is top notch the heatsink fans are pretty much twice the length of the actual gpus pcb Furthermore after more than two weeks of using the gpu I can say that the gaming performance is very good especially with the DLSS and FrameGen technologies Been a buyer of MSIs top end gpus for a while now starting with the GTX Ti Very good quality packaging and handling overall Highly recommended Ps I am very glad I chose this over the Ventus despite the significant price diff as that card apparently has cooling issues and whatnot In case you dont have a new PSU with a dedicated VHPWR port and cable this product includes NVIDIAs VHPWR adapter btw You need the usual x pin PCIE cables in order to use it', 5, '2020-09-08 22:43:26', NULL);
