INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (54140, 66, 1248, 'Work as intended plug and play Authentic QVL Ram kit Dual channel and it work on dual channel sticks on my setup Unli google chrome tabs hahaha Jokes aside di ko naman binili ito for giggles Binili ko ito for future proof since nagmumura na ddr due to being low demand but high supply and ddr are being the target for more builds Ddr is still good Having gb kit is enough for many but I just take advantage to buy another to fill my remaining slots I am multitask that loves to tinker on virtualization trying some linux distro and learning from it I also try want to try how servers works through emulation and my ram capacity will be enough for it Anyhow the ramkit works flawlessly No hiccups so whatever Being QVL qualified vendor list on both of my processor veermer or series ryzen and motherboard xs makes it stable and insured that they will work properly I am not saying that if this ram kit is not a qvl in your processor and mother board will mean its not compatible in your system It will still work as long as your are using a system that uses ddr', 5, '2020-04-13 07:30:19', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (54141, 6, 1146, 'Legit GSkill Ripjaws Item packaged well and arrived earlier than expected date Had to install and test the item first before rating No issues encountered so far Satisfied with the quality Happy with the purchase', 5, '2023-10-06 10:42:05', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (54142, 62, 282, 'Price to performance ram kit QVL mhz x ram kit Original and brand new I am grateful for the quick delivery It only took days to be delivered It is a QVL qualified vendor list ram kit for my processor and motherboard which is guaranteed to work without hiccups or any tinkering needed to work You need to turn on xmpdocp for the mhz frequency to be applied Gskill producy website shows what are the processor and motherboard that are supported on this ram kit It supports series ryzen processors and selected bxxs processor In my case using r and xs gaming x mobo are supported Planning to buy another kit to fill the remaining slot Thanks itw for selling legit and original product Also great thanks for the voucher got a k discount of it', 5, '2020-10-10 00:19:20', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (54143, 6, 331, 'A good memory option for those in tight budget builds and dont really care much about RGB Works well and at full mhz on my pc', 5, '2021-06-14 19:51:15', NULL);
