INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (58744, 19, 390, 'Free from deficiencies matte not glossy silent as the product description says and response is normal So convenient to navigate compared to my old Logitech mouse Magnetic cover slip quite new to me Ive been eyeing this mouse last week since its one of the cheapest bluetooth legit mouse As someone who often uses iPad navigating is becoming more hassle to me especially when Im working with my essays etc so buying this product will lessen that hassle It is also a good thing that the response of the device is functioning well and works pretty smooth Also its very convenient to bring since it doesnt weigh that much and the design is not bulky Plus there are many colors to pick compared to the pricey logitech pebble mouse and it doesnt even have any differences in terms of performance so buy responsibly For those who are after its aesthetics Id say this is still on par with the other expensive pebble mouse but more simple and neat Moreover no one would probably care about how it looks if you put some silicon case so it wont get dirty or oily', 5, '2022-08-19 01:43:35', NULL);
