INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60221, 38, 238, 'Maganda solid ang quality nito worth to buy Offers a lot of customization for more productive life style Sulit sa performance easy to use and iconnect sa ibang devices at marami ding offer for customize work flow', 5, '2022-03-17 15:55:45', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60222, 16, 935, 'Worth every centavo Premium materials and efficient features It justifies the hype It is as smooth as claimed and really fast much faster than my old lowtech mouse I bought this to prevent stress on my wrist since I work long hours from home I mostly use my mouse than my keyboard as well so its important that I get a very good one to replace my trusty mouse I did not get disappointed It was so expensive for me hahaha So far the biggest splurge on a computer peripheral But it was so worth it I can see years of great service from this mouse already hahaha the ergonomic design It feels different and it fits my hand well I do have a big hand hahaha But Ive always used a logitech mouse even my very old one is a logi mouse But this was really designed well plus the buttons were well thought of But comfort and ease of use is fundamental to how they designed this mouse Plus the thumb buttons are so accessible and easy on the hand You dont need to move your hand so much to click or drag something on your computer Plus there are so many ways to easily use this mouse on your computer Just choose one that best fits your gear and intention Its a great addition to any set up as well I use Windows of course but other users would be happy to use this as well', 5, '2021-11-15 00:43:32', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60223, 84, 211, 'Up and down left and right scroll wheels Built looks good Very responsive and smooth to use I like the way how its very responsive Im just a but uncomfortable with the design since my previous mouse was smaller I feel cautious to glide as my previous one was not that responsive Although its very responsive the design causes a bit delay with how I work since Im feeling very cautious Ill get the hang of it soon Its been just my second day of using it and it really occupies my palm', 5, '2020-04-23 01:36:31', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60224, 25, 393, 'MagSpeed Thumbwheel Silent Clicks Premium The mouse is ergonomic and really good for productivity The design is ergonomic really comfortable on my hand I hope it lasts longer than my previous mouse', 5, '2021-10-21 18:16:41', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60225, 8, 219, 'BANG FOR THE BUCK Still yet to teat but based on youtube reviews it is superb Product was packed nicely A little dimple on the box but doesnt matter since mouse was undamaged Scroll wheels feel exemplary Sarap sa feeling Might want to complete the Logitech Master series after this purchase Siyempre sa same store para legit', 5, '2021-10-08 12:46:19', NULL);
