INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60231, 96, 358, 'Bang for the buck Good thing I got it on sale Plus I got the international version Others shop will sell it at a cheaper price but mostly sells the chinese version I am not sure if theres much of a difference other than the packaging And it is straight from Logitech Phillipines The mouse performs very well as advertised and based on existing reviews You can search the internet and will find very good reviews about the product I had a Logitech mouse for years and sadly I had to replace it since the right click button is already starting to be unresponsive Hopefully this one will last for years and get my moneys worth Quiet and tons of customization Geared towards productivity Do your research first and take time to get to know the product Good buy if you get it on sale The seller responded to my inquiries P S It would have been great if they take a photo of the product before shipping Some couriers are a bit nasty when handling parcels But overall great product from Logitech', 5, '2021-10-06 02:46:18', NULL);
INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60232, 87, 879, 'Buttons and scroll wheels are super responsive Made of high quality plastic mattefinished Silent buttons and smooth scrolling One of the best mice you can get on this price point A little heavy for gaming but it is very responsive for fast gestures All buttons are fully customizable on the Logi Options app It also has Flow feature where you can hover the mouse cursor to another computer desktop where the device is already setup which can be used to copy files accross devices I think I wont be using any other mouse now that I have this', 5, '2020-07-08 02:39:19', NULL);
