INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (60345, 80, 21, 'love it wireless the best One of my favorite things I bought here sa Shopee Yay Wires no more One of best decisions Ive made this year is to buy this one Sulit naman since no hassle na Lagi ko kasi nahuhulog headset ko before because may wire sya so I looked for a wireless one then I found this Also amazed na wala syang usb to connect the bluetooth like the ones with wireless mouse and keyboard Just worried how am I going to clean this if it gets dirty na over time because I got the lighter color Over all stars Thank you Logitech', 5, '2022-03-28 12:11:18', NULL);
