INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (62434, 9, 220, 'The degrees surround sound out of Superb Quality WORTH THE PRICE quite hesitant before pero naconvince based sa mga good reviews sa YouTube Real talk okay ang sounds maririnig mo talaga yung clarity ng sounds and mostly if youre a musician very particular ka sa mga music instruments sa background ng mga songs which is yun yung nagustuhan ko kay MegaBoom detalyado yung nilalabas nyang sounds speaking of quality pag nasa na yung volume medyo overpowered ng tremble and mid yung bass pero okay lang naman still andun pa din yung clarity and hindi basag Then lastly medyo short range lang yung bluetooth nya pag walang obstacles i think nasa meters then pag meron na siguro nasa meters na lang Nacompare ko kc sya sa isang bluetooth speaker ko Yun lang naman OVERALLit really exceeds my expectations sa isang bluetooth speaker heavy duty pa siya pwedeng pwede sa outdoors as i tried it already sa mga ride ko and hindi napuputol yung sounds unlike sa ibang Bluetooth speakers I must say this was a great buy for me Thank you seller for speedy shipment and good packaging as well Definitely will purchase again Til our next transaction Cheers', 5, '2020-09-23 16:41:42', NULL);
