INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (62689, 90, 764, 'Premium mouse Improved workflow My main mouse was the Anywhere s for years since the MX Master didnt rly match my claw grip and it was too heavy When scroll wheel started to become less stable and the rubber peeling off I found the nxt best thing logi g Not marketed as productivity but gaming It had hyperscroll the useful Gswitch and programmable side buttons But wheel was flimsy still a bit heavy even w lithium bat and same ugly rubber coating The anywhere wouldve been perfect IF it had onboard memory I wanted to use this on laptops but is work provided so I cant install Logi So what use is the great customization if my profile is lost when I switch to another laptop wo the program Tbh if the g had same build quality as MX line Id still stick to it The silicone on MX was a good upgrade too Saving grace was that point and scroll settings saved even when switching so I RLY dont get why they didnt just have onboard memory altogether', 4, '2021-09-16 13:40:35', NULL);
