INSERT INTO comments (id, user_id, product_id, text, rating, created_at, updated_at) VALUES (63377, 86, 263, 'About of cases of Ludwigs angina or cellulitis of the submandibular space are caused by dental infections Mixed infections due to both aerobes and anaerobes are commonly associated with this type of cellulitis Typically this includes alphahemolytic streptococci staphylococci and bacteroides groups Predisposing conditions for cellulitis include an insect or spider bite blistering an animal bite tattoos pruritic itchy skin rash recent surgery athletes foot dry skin eczema injecting drugs especially subcutaneous or intramuscular injection or where an attempted intravenous injection misses or blows the vein pregnancy diabetes and obesity which can affect circulation as well as burns and boils although debate exists as to whether minor foot lesions contribute Occurrences of cellulitis may also be associated with the rare condition hidradenitis suppurativa or dissecting cellulitis', 5, '2022-09-10 01:23:19', NULL);
